San Miguel de Salinas / Sant Miquel de les Salines es un municipio de la Comunidad Valenciana. Situado en el sur de la provincia de Alicante, en la comarca de la Vega Baja del Segura. Situado entre Torrevieja y Pilar de la Horadada, es el pueblo más elevado de la comarca. Los 54 km² de término municipal bajan desde la montaña en un trazado de ramblas, barrancos y colinas hasta la llanura, conocida como El Llano donde se encuentra el campo de las salinas que es la zona de cultivo. El principal sector económico es el agrícola, aunque también tiran de la economía la industria y la construcción impulsadas por el desarrollo del sector turístico gracias a su proximidad a la costa. 
#ref:SH/60531750'}

